	<div class="site-inner"><div class="wrap"><div class="content-sidebar-wrap"><main class="content"><article class="post-12 page type-page status-publish entry" aria-label="Privacy" itemscope="" itemtype="https://schema.org/CreativeWork"><header class="entry-header"></header><div class="entry-content" itemprop="text"><h5>Our Privacy Policy</h5>
<p>www.SmartMerchantProcessing.com is owned and operated by Smart Merchant Processing, Corp. Privacy is very important to us and we are committed to safeguarding the privacy of our website visitors. Our Privacy Policy is outlined below and sets out how we will treat your personal information.</p>
<h5>Information Collected</h5>
<p>We may collect, store and use the following kinds of personal data:</p>
<p>&#8211; information about your visits to and use of this website including but not limited to:</p>
<p>&#8211; IP address, geographical location, browser type, referral source, length of visit and number of page views.</p>
<p>&#8211; information about any transactions carried out between you and us on or in relation to this website, including information relating to any purchases you make of our services.</p>
<p>&#8211; information that you provide for the purpose of registering with us and/or subscribing to our website services and/or email notifications.</p>
<h5>Use of Your Personal Data</h5>
<p>Personal data submitted on this website will be used for the purposes specified in this privacy policy or in relevant parts of the website. In addition to the uses identified elsewhere in this privacy policy, we may use your personal information as follows:</p>
<p>&#8211; for the administration of this website, to improve the website&#8217;s usability, and for marketing purposes.</p>
<p>&#8211; to send information (other than marketing communications) to you which we think may be of interest to you by post, email, or similar technology.</p>
<h5>General Disclosures</h5>
<p>In addition to the disclosures reasonably necessary for the purposes identified elsewhere in this privacy policy, we may disclose information about you:</p>
<p>&#8211; to the extent that we are required to do so by law</p>
<p>&#8211; in connection with any legal proceedings or prospective legal proceedings</p>
<p>&#8211; in order to establish, exercise or defend our legal rights (including providing information to others for the purposes of fraud prevention and reducing credit risk)</p>
<p>&#8211; to the purchaser or seller (or prospective purchaser or seller) of any business or asset which we are (or are considering) selling or purchasing. Except as provided in this privacy policy, we will not provide your information to third parties.</p>
<h5>Security of Your Personal Data</h5>
<p>We will take reasonable precautions to prevent the loss, misuse, theft or alteration of your personal information. Since data transmission over the Internet is inherently insecure, we cannot guarantee the security of data sent over the Internet.</p>
<p><strong>Privacy Policy Changes</strong></p>
<p>We may update this privacy policy from time-to-time by posting a new version on our website. We encourage you to check this page occasionally to review our policy changes.</p>
<h5>Third Party Websites</h5>
<p>The website may contain links to other websites. We are not responsible for the privacy policies of third party websites.</p>
<h5>Contact</h5>
<p>If you have any questions about this privacy policy or our treatment of your personal data, please write to us (Smart Merchant Processing) by email to <a href="305-445-SMP" target="_blank">info@smartmerchantprocessing.com</a> or by mail to 2665 South Bayshore Drive, Suite 450, Coconut Grove, FL 33133.</p>
